import React from 'react'

function SignupForm({ isVisible, onClose }) {
    if (!isVisible) return null;

    const handleClose = (e) => {
        if (e.target.id === 'signupWrapper') onClose()
    }

    return (
        <main>
            <div className='fixed inset-0 bg-black bg-opacity-25 backdrop-blur-sm flex justify-center items-center' id='signupWrapper' onClick={handleClose}>
                <div className='w-[450px] sm:w-[600px] flex flex-col'>
                    <button className='text-white text-xl place-self-end hover:scale-150 transition-all' onClick={() => onClose()}>X</button>
                    <div className='bg-white p-2 rounded'>
                        Signup Form
                    </div>
                </div>
            </div>
        </main>
    )
}

export default SignupForm
